import Star from '../../../assets/logos/Star.svg';
import style from './Rate.module.scss';

const Rate = ({ rate }) => {
    return (
        <div className={s.rate}>
            <img src={star} alt="star" />
            <span className={s.rating}>{rate}</span>
        </div>
    );
}

export default Rate;
